import React from 'react'
import {Link} from "react-router-dom"
import Accordion from 'react-bootstrap/Accordion';

const numBut = ["1","2"];
let listBut = [];
for(let i in numBut){
    listBut.push(<div className='Item'>
        <button value={i}>{i}</button>
        </div>);
}

export const MainPage = () => {
  return (
    <div className='Content'>
        <div>{listBut}</div>
    </div>
  )
}
